import React from "react";
import { View, Text, StyleSheet,TouchableOpacity,Button, Alert } from "react-native";
import { Card, Title, Paragraph,}  from 'react-native-paper';
import { MaterialCommunityIcons } from '@expo/vector-icons'; 

const Home = ({navigation}) => {
  const onPress = () => navigation.navigate("Tools");
  return (
      // <View style={styles.center}>
      //   <Text>This is the home screen</Text>
      //   <Button title="Go to About Screen"  onPress={() => navigation.navigate("Tools")}/>
      //   <Button title="Go to Cart"  onPress={() => navigation.navigate("Cart")}/>
      // </View>
  
    <TouchableOpacity  onPress={onPress}>
     
     <Card style = {styles.cardStyle}>
     <Card.Content>
    <MaterialCommunityIcons name="bed-empty" size={32} color="black" />
     <Button onPress = {onPress}>Rooms</Button>
    </Card.Content>
    </Card>
    <Button
        title="Press me"
        color="#f194ff"
        onPress={() => Alert.alert('Button with adjusted color pressed')}
      />
    </TouchableOpacity>
    
 
  );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#242945',
        alignItems: 'center',
        justifyContent: 'center',
      
       
    },
    cardStyle: {
        
        width: '30%',
        backgroundColor:'#d4aa04',
        // flexDirection: 'row',
        margin: '1.6%',
       
    }

}
)


export default Home;
